import '../css/navbar.css'

export default function navbar(){
	return (
			<nav className="navbar">
				<div className="pages">
					<div className="devicesPage">Devices</div>
					<div className="ImageUploadPage">Image Upload</div>
				</div>
			</nav>
	)
}
